import React, { Component } from 'react';

class Counter extends Component {
    state = {
        count: 1
    }

    styles = {
        fontSize: 10,
        fontWeight: ""
    }

    render() {
        return (
            <div>
                <span className={"badge badge-primary m-5"}>{this.state.count}</span>
                <button className={"btn btn-primary btn-sm"}>sample</button>
            </div>
        );
    }
}

export default Counter;
